                <br />
                <li>Add your favourite movies in the favourite Movies List.</li>
              </ul>{" "}
              <br />
              And enjoy the Experience on Movies on the Tip.
            </p>
          </div>
        </section>
      </main>
    </div>
  );
};

export default Home;
